'''Lieutenant of the Tower of Barad-dûr''' was the title of an important commander in the land of [[Mordor]]. Its associated details and duties are unknown, but at the time of the [[War of the Ring]] it was borne by the [[Men|Man]] known as the [[The Mouth of Sauron]].<ref>{{RK|V10}}</ref>

